!\'\'\'\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),('en','messages:movepagetalktext','s:247:\"The associated talk page will be automatically moved along with it \'\'\'unless:\'\'\'\n*A non-empty talk page already exists under the new name, or\n*You uncheck the box below.\n\nIn those cases, you will have to move or merge the page manually if desired.\";'),('en','messages:movearticle','s:10:\"Move page:\";'),('en','messages:moveuserpage-warning','s:132:\"\'\'\'Warning:\'\'\' You are about to move a user page. Please note that only the page will be moved and the user will \'\'not\'\' be renamed.\";'),('en','messages:movenologin','s:13:\"Not logged in\";'),('en','messages:movenologintext','s:81:\"You must be a registered user and [[Special:UserLogin|logged in]] to move a page.\";'),('en','messages:movenotallowed','s:41:\"You do not have permission to move pages.\";'),('en','messages:movenotallowedfile','s:41:\"You do not have permission to move files.\";'),('en','messages:cant-move-user-page','s:68:\"You do not have permission to move user pages (apart from subpages).\";'),('en','messages:cant-move-to-user-page','s:84:\"You do not have permission to move a page to a user page (except to a user subpage).\";'),('en','messages:newtitle','s:13:\"To new title:\";'),('en','messages:move-watch','s:33:\"Watch source page and target page\";'),('en','messages:movepagebtn','s:9:\"Move page\";'),('en','messages:pagemovedsub','s:14:\"Move succeeded\";'),('en','messages:movepage-moved','s:33:\"\'\'\'\"$1\" has been moved to \"$2\"\'\'\'\";'),('en','messages:movepage-moved-redirect','s:28:\"A redirect has been created.\";'),('en','messages:movepage-moved-noredirect','s:47:\"The creation of a redirect has been suppressed.\";'),('en','messages:articleexists','s:105:\"A page of that name already exists, or the name you have chosen is not valid.\nPlease choose another name.\";'),('en','me